import Navigation from './components/Navigation'

const Header = ({className, data}) => {
  const {name, navigation} = data

  return (
    <header 
      data-name={name}
      className={className ? className : 'header'} 
    >
      <div className={`${className}__wrapper`}>
        {navigation && (
          <Navigation 
            className={className} 
            navigation={navigation}/>
        )}

        <button 
          data-btn="theme" 
          data-theme="moon"
          className={`${className}__theme`} 
        >
          {MoonIcon()}
        </button>

        <button 
          data-btn="burger"
          className={`${className}__burger`} 
        >
          <span></span>
        </button>    
      </div>
    </header>
  )
}

export default Header
